import React from 'react';
import s from "./Household.module.css";
import Category from "../Category/Category";
import Subcategories from "../Subcategories/Subcategories.js";
import Adverts from "../../Adverts/Adverts";

import archtect from './../architect.svg';
import auto from './../auto.svg';
import fridge from './../fridge.svg';
import furniture from './../furniture.svg';

const Household = (props) => {
  return (
      <div>
        <h3>Выберите категорию</h3>
        <div className={s.content}>
          <div className={s.categories}>
            <Category nameCategory={'Недвижимость'} imgPath={archtect} urlCategory={'nedvijimost'}/>
            <Category nameCategory={'Транспорт'} imgPath={auto} urlCategory={'transport'}/>
            <Subcategories nameSubCat={'Бытовая техника'} imgPath={fridge} urlCategory={'all_for_home'} urlSubcategory={'bitovaya_technika'}/>
            <Subcategories nameSubCat={'Мебель'} imgPath={furniture} urlCategory={'all_for_home'} urlSubcategory={'mebel'}/>
          </div>
        </div>
      </div>
  );
};

export default Household;
